import React, { useState } from "react";
import '.'


const FORM_ENDPOINT = ""; // TODO - filled at the 2nd return section

const ContactForm = () => {
  const [submitted, setSubmitted] = useState(false);
  const handleSubmit = () => {
    setTimeout(() => {
      setSubmitted(true);
    }, 100);
  };


  if (submitted) {
    return (
      <>
        <div className="text-2xl">Thank you!</div>
        <div className="text-md">We'll be in touch soon.</div>
      </>
    );
  }

  return (
    <form
      action={FORM_ENDPOINT}
      onSubmit={handleSubmit}
      method="POST"
      target="_blank"
      style={{ padding: "20px" }} // add this line to add padding
    >

    <div className="col-sm-10">
      <form className="form-horizontal" />                     
          
          <div className="form-group row">
              <label className="control-label col-sm-2">First Name:</label>
                <div className="col-sm-4">
                    <input type="firstname" className="form-control form-control-sm" id="colFormLabelSm" placeholder="John" />
                </div>
              <label className="control-label col-sm-2">Last Name:</label>
                <div className="col-sm-4">
                    <input type="lastname" className="form-control form-control-sm" id="colFormLabelSm" placeholder="Doe" />
                </div>
          </div>
      </div>

      <div class="col-sm-10">
        <div className="form-group row">
          <label className="control-label col-sm-2">Email:</label>
              <div className="col-sm-4">
                  <input type="email" className="form-control form-control-sm" id="colFormLabelSm" placeholder="example@email.com" />
              </div>                            
          <label className="control-label col-sm-2">Confirm Email:</label>
              <div className="col-sm-4">
                  <input type="confirmemail" className="form-control form-control-sm" id="colFormLabelSm" placeholder="example@email.com" />
              </div>
        </div>
      </div>

      <div class="col-sm-10">
        <div class="form-group row">
          <label class="control-label col-sm-2">Day Contact:</label>
              <div class="col-sm-4">
                  <input type="daycontact" class="form-control form-control-sm" id="colFormLabelSm" placeholder="01234567890" />
              </div>                            
          <label class="control-label col-sm-2">Mobile Contact:</label>
              <div class="col-sm-4">
                  <input type="mobilecontact" class="form-control form-control-sm" id="colFormLabelSm" placeholder="+44 1234567890" />
              </div>
        </div>
      </div>


      <div>
        <label className="control-label col-sm-2">Your message</label>
          <div className="mb-3 mt-3">
              <textarea
                placeholder="Your message"
                name="message"
                class="form-control col-sm-10"
                rows={5}
                required
              />
        </div>
      </div>

      <div className="mb-3 mt-3">
        <div className="col-sm-4"></div>
        
        <button
          type="submit"
          className="active:bg-blue-600 font-bold uppercase text-sm px-5 py-3 rounded shadow hover:shadow-lg mr-1 mb-1 ease-linear transition-all duration-150"
          // style={{
          //   backgroundColor: "#4a9fd6", // Change the background color to blue
          //   color: "#ffffff", // Change the text color to white
          //   border: "none", // Remove the border
          //   outlineColor: "#4a9fd6" // Change the outline color to blue
          // }}
        >
          Submit
        </button>




      </div>

    </form>
  );
};

export default ContactForm;
